    "2016-07-27T22:41:33.834694",nt"name": "an-assessment-of-mercury-in-waters-sediments-and-biota-of-vermont-and-new-hampshire-lakes-",nt"isopen":
    false,nt"url": null,nt"notes": "The present report summarizes findings
    of a three-year field study of mercury in freshwater lakes of Vermont and New Hampshire.
    The study was undertaken jointly by the Vermont Department of Environmental Conservation,
    New Hampshire Department of Environmental Services, and Syracuse University. The
    study was designed specifically to determine the generalized level of mercury contamination
    in sediment, water, and biota of multiple trophic levels across the VT-NH region,
    using a geographically randomized approach. This type of approach ensures that results
    provide a statistically valid representation of region-wide conditions. In this
    summary, average mercury concentrations are provided for several types of measurements,
    along with the 95% confidence intervals. Results of data analyses are highlighted,
    and interpretations that carry significant management implications are discussed.
    These values are discussed in light of currently available guidelines or water quality
    criteria.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
